const BirdInfo = () => {
  useEffect(() => {
    const currentInfo = useSelector(selectCurrentBirdsInfo);
  }, [selectCurrentBirdsInfo]);

  return (
    <div className="bird-info">
      {currentInfo ? (
        <div>
